B.Kb=new A.ya("Terra CUSTOM SOLUTIONS FOR CLIENT PROJECTS","Our clients are diverse. Their projects can have very different needs. Here are just some examples of solutions we have been proud to deliver:","CITIC Pacific Mining\u2019s Sino Iron Project","At the time, the largest planned magnetite project in Australia, we supplied and commissioned 8 BOGE Compressors \u2013 3 BOGE S151 (110kW Screw Compressors), 1 BOGE S180 (132kW Screw Compressor), 2 BOGE S61 (45kW Screw Compressors), 1 BOGE S271 (200kW Screw Compressor, and 1 BOGE SD20-2 (15kW Screw Compressor).","Chevron","We supplied and commissioned three containerised instrument air packages. There were 6 BOGE 30kW Screw Compressors and associated filtration equipment that were modified per Chevron\u2019s requirements. We used Transair Aluminum piping for interconnecting pipework.","Houghton Winery","We conducted a compressed air energy audit and discovered that their compressed air demand was much higher during the harvest, which was only a few months a year. This meant that the rest of the year, the compressor was running offloaded and inefficiently. We installed a direct drive, variable speed BOGE SLF 75 compressor. Now the winery can run both profiles without all that wasted energy.","Railway Undercarriage Compressor System","For one client\u2019s specs, we supplied direct drive compact units, complete with variable speed drives. We installed a BOGE CL10 Compressor mounted under the deck and a SLF75 in the carriage for rail grinding.","Customised Waterproofing Solution","We delivered a weatherproofing package on a S125-2 to cope with cyclone conditions. The package included Pre filter louvers with easy access for Pre filter changes. The Focus controller cover was designed to protect against sun and rain, and hot air discharge ducting was used to prevent rain from entering the oil cooler into the compressor.","Compact Skid Units","We designed and manufactured skids to accommodate a client\u2019s Nitrogen generation skid. We\u2019ve also developed skids to accommodate compressors, receivers, and dryers\u2013fully piped, wired, and ready to install without the need for major foundation works.",null)
B.Kc=new A.ya("CORE VALUES","We call them SCAITS. We demonstrate these values in everything we do. They are ingrained into everyone who is partof our business. They are what make us the go-to solution whenAustralians want dependable products adn reliable service.","SERVICE","We understand that when a client is successful, we are successful. We value our clients\u2019 business, trust, and feedback, and strive to provide them with the best products and service. We want them to know we care.","COMMITMENT","We believe that in order to have action, you first need commitment. Commitment itself has two components: a sound set of beliefs and faithful adherence to those beliefs. We believe that commitment \u201cignites\u201d action and in \u201cpersistence with a purpose\u201d.","ACCOUNTABILITY","We are happy to be judged by what we do \u2013 as opposed to what we say we will do \u2013 because, very simply, we do what we say we will do. This is a value we demand not only in our relationship and interactions with clients but in ourselves as well. Being accountable allows us to develop positive life skills, make better decisions, and be better people.","INTEGRITY","Trust is earned. By working safely, professionally, and ethically \u2013 regardless of the cost or difficulty involved \u2013 we have earned the trust of Western Australia to become its biggest independent air compressor provider. We take that trust seriously; even if we\u2019ve already earned it, we confirm it.","TECHNOLOGY","Quality, innovation, evolution. These are the foundations for more than just success. They are the backbone of competitive advantage. We embrace technology because it allows us to bring the very best products to you and to maintain those products over the long.","SOCIAL RESPONSIBILITY","We believe that our quality of life is improved by providing committed service and expertise to our clients, and by contributing to local communities and society as a whole. We lead by example to make our community and industry stronger.",null)
